            "fqsen": "\\Booka\\Tours\\Calendar\u003A\u003Aindex\u0028\u0029",
            "name": "index",
            "summary": "retrieve\u0020tour\u0020information\u0020to\u0020be\u0020shown\u0020in\u0020the\u0020tour\u0020calendar\nreturns\u0020an\u0020object\u0020of\u0020tour\u0020items\u0020with\u0020the\u0020following\u0020properties\nfullcalendar.js\u0020properties\n\u002D\u0020id\u0020\u0028integer\u0029\u0020uniquely\u0020identifies\u0020the\u0020given\u0020event\n\u002D\u0020title\u0020\u0028string\u0029\u0020text\u0020on\u0020the\u0020event\n\u002D\u0020start\u0020\u0028string\u0029\u0020the\u0020date\/time\u0020a\u0020tour\u0020begins\u0020\u005B1\u005D\n\u002D\u0020end\u0020\u0028string\u0029\u0020the\u0020date\/time\u0020AFTER\u0020a\u0020tour\u0020ends\u0020\u005B1\u005D\n\u002D\u0020className\u0020\u0028string\u007Carray\u0029\u0020a\u0020CSS\u0020class\u0020\u0028or\u0020array\u0020of\u0020classes\u0029\u0020to\u0020format\n\u0020\u0020\u0020\u0020\u0020this\u0020tour\u0020element\n\u002D\u0020color\u0020\u0028string\u0029\u0020sets\u0020a\u0020tour\u0027s\u0020background\u0020and\u0020border\u0020color\n\u002D\u0020backgroundColor\u0020\u0028string\u0029\u0020sets\u0020a\u0020tour\u0027s\u0020background\u0020color\n\u002D\u0020borderColor\u0020\u0028string\u0029\u0020sets\u0020a\u0020tours\u0027s\u0020border\u0020color\n\u002D\u0020textColor\u0020\u0028string\u0029\u0020sets\u0020a\u0020tour\u0027s\u0020text\u0020color\n\u002D\u0020allDay\u0020\u0028boolean\u0029\u0020true\u0020if\u0020tour\u0020is\u0020all\u0020day\u0020event\nBooka\u0020\u0020\u0020\u0020properties\n\u002D\u0020seats\u0020\u0028array\u0029\u0020information\u0020about\u0020available\u0020seats\u0020on\u0020this\u0020tour\n\u0020\u0020\u002D\u0020title\n\u0020\u0020\u002D\u0020total\u0020\u005B2\u005D\n\u0020\u0020\u002D\u0020available\n\u002D\u0020pickup\u0020\u0028array\u0029\u0020information\u0020about\u0020available\u0020pickups\n\u0020\u0020\u002D\u0020total\u0020\u005B2\u005D\n\u0020\u0020\u002D\u0020available\n\u002D\u0020description\u0020\u0028string\u0029\u0020tour\u0020description\n\u002D\u0020freeseats\u0020\u0028int\u0029\u0020total\u0020free\u0020seats\u0020ontour\n\u002D\u0020show_booknow\u0020\u0028bool\u0029\u0020if\u0020booknow\u0020button\u0020should\u0020be\u0020shown\u0020\u005B3\u005D\n\u002D\u0020show_reports\u0020\u0028bool\u0029\u0020if\u0020reports\u0020button\u0020should\u0020be\u0020shown\u0020\u005B3\u005D\n\u007D\n\u005B1\u005D\u0020moment\u002Dish\u0020input,\u0020will\u0020become\u0020a\u0020real\u0020moment.js\u0020object\u0020after\u0020parsing\n\u005B2\u005D\u0020value\u0020available\u0020for\u0020booker\u0020role\u0020and\u0020above\n\u005B3\u005D\u0020depends\u0020on\u0020user\u0020role\u0020and\u0020user\u0020rights",
